import React from 'react';
import styled from 'styled-components';

const BoardContainer = styled.div`
  background: #fff;
  width: 500px;
  height: 500px;
  border-radius: 16px;
  box-shadow: -6px 10px 30px 4px #00000033;
  border: 20px solid #fff;
`
const Board = styled.div`
background-color: #999999;
width: 100%;
height: 100%;
`

function App() {
  return (
    <BoardContainer>
      <Board>
        Test
      </Board>
    </BoardContainer>
  );
}

export default App;
